var tipuesearch = {"pages": [{'title': 'About', 'text': '這是陳冠宇的網站 \n 這次的協同產品設計，改變了我對機械設計工程系的認知，之前以為在課本上的理論，只是課堂用的到的學術理論，而這次的協同產品設計，讓我看到學術理論之所以重要是因為當今天在產品設計時，學術理論與設計產品是環環相扣的，在畫圖這塊我了解了我的不足，當同學在畫圖是我就易邊看，一邊多學一點繪圖技巧 \n 在打程式這塊是一個非常深的領域，我常常跟同學一起討論如何將程式做出我們想要的結果。 \n 有時因為軟體限制無法做出我們想要的結果，我們就會討論使用其他的軟體，或是將一些地方更改參數，來達到我們想要的結果。 \n \n \n', 'tags': '', 'url': 'About.html'}, {'title': 'stage1-22', 'text': '陳冠宇的網站 \n 陳冠宇的倉儲 \n 黃翊銘的網站 \n 黃翊銘的倉儲 \n stage1 ag22 的網站 \n stage1 ag22 的倉儲 \n 產品主題 \n "多功能變型家具" \n 設計理念 \n 由於現在台灣地價飆漲，百姓的生活空間受到壓迫，為了最大限度的節省空間，我們才想說做一個可以變形並且方便收納的多功能變形家具 \n 我們最後選擇將椅子和桌子融合在一起，因為對於大學生來說要租到一間便宜，空間又大的房間，是可遇不可求的，魚和熊掌不可兼得的道理，基本上很難能兩全其美，所以既然空間不夠，那就將不必要的物品收起來，經過我們調查，很多時候我們其實只用的到一樣東西，不會同時需要使用，所以當今天有同學來家裡聊天就可以搬出我們設計的這款多功能變型家具，變成椅子讓客人坐，要是要做學術討論，將椅子變桌子一起討論，要是不用時又可以變成裝置藝術，簡直是一舉三得的好產品阿~~~(✿◕‿◕✿) \n \n 還不快來贊助我們!!! \n', 'tags': '', 'url': 'stage1-22.html'}, {'title': 'W1', 'text': '剛開始的第一周，我找了強者我朋友，來補足我畫圖的不足，然後我們開始討論，要設計什麼主題的產品，一開始我想要單純設計一個日內瓦機構，但我們討論後發現，我們都想要做一項驚為天人的產品設計 \n', 'tags': '', 'url': 'W1.html'}, {'title': 'W2', 'text': '這周我們已經構想好要做的主題大致的方向了，為多功能變型家具，接下來我跟我的隊友，開始了細節的討論，我們一邊畫圖一邊架網站，這時我們的網站是使用不成熟的方式推送，由一個人為網站持有者，並且由他推送，因為在短短的四週內，不知道要怎麼使用共同協同網站，我們將心力放在如何將這項產品，設計出來並且使其真正作動。 \n', 'tags': '', 'url': 'W2.html'}, {'title': 'W3', 'text': '這周我們將我們的設計圖都畫好，並且確定各個機件組合間不會有問題，以及任何意想不到的缺陷，我們將多功能變型家具丟入CoppliaSim進行模擬，然後將機構上彩圖，讓我們出圖時，外觀上比較好看 \n', 'tags': '', 'url': 'W3.html'}, {'title': 'W4', 'text': '多功能變型家具 之呈現 \n 點我看報告 \n', 'tags': '', 'url': 'W4.html'}, {'title': '進度', 'text': '3月4日 \n 討論基礎外型及功能 \n \n 3月7日 \n 在設計系部結構時，我們遇到了產品無法達到預期的效果進行了第一次改版 \n 3月10日 \n 產品細節討論 \n \n 3月16日 \n 網站修復 \n', 'tags': '', 'url': '進度.html'}, {'title': 'stage2-2', 'text': '陳冠宇的網站 \n 陳冠宇的倉儲 \n 黃翊銘的網站 \n 黃翊銘的倉儲 \n 蔡朝旭的網站 \n 蔡朝旭的倉儲 \n stage2 ag2 的網站 \n stage2 ag2 的倉儲 \n \n 產品主題 \xa0 : 變速機構\xa0Transmission mechanism \n \n 設計理念 \xa0 \xa0 : \xa0 由於這幾年各國經濟起飛家家戶戶都賺的盆滿鍋滿，有了錢就想要消費，於是想到有錢人都會買車，於是每個家庭必備了一台車，所以汽車業蓬勃發展，各個國家在汽車市場，都想要分杯羹。 然而台灣的汽車業有如剛出生的小羊，嗷嗷待哺一般，剛踏入市場，引擎跟人買，變速箱跟人拿，車架跟人借 所以為了能幫助台灣汽車業蒸蒸日上，所以我們決定全車由我們台灣人自己設計製造，但想要一步登天，將全車在這短短的一個月內設計出來有如癩蛤蟆想吃天鵝肉，所以這次協同產品設計，我們決定先設計汽車中至關重要的變速箱系統。 想要在換檔的時候不會有太大的震動，想要在起跑上贏過別人，想要在尾速速度可以繼續延伸，現在我們就來設計出台灣特有的變速箱，讓世界看見台灣!!! \n \n 設計目標 \xa0 : 畫出一個有 N,1,2,3檔位的變速機構，並以CoppeliaSim模擬作動且用comsol找出最大承受應力、扭矩、主要受力部位。 \n', 'tags': '', 'url': 'stage2-2.html'}, {'title': 'W5', 'text': '這一周是新的開始，多加了新的成員，是位操縱github及各大軟體，相當有經驗的一位學長，可以說是他在我們組後，我們這組整體素值水平都高出了許多，在訂定主題時我們也大膽地選擇了變速箱，難度較為高端的機構。 \n', 'tags': '', 'url': 'W5.html'}, {'title': 'W6', 'text': '一樣不免俗的，一樣地架網站，不同已往的是我們的分組網站是每個人都可以，隨時更改的，不僅僅提供了效率，也讓我們在製作專題的過程中學到了新的知識。並且這周我們將每個變速箱的零件都畫出來，並且開始模擬CoppliaSim。 \n', 'tags': '', 'url': 'W6.html'}, {'title': 'W7', 'text': '這一周我將齒輪放進coppeliaSim做模擬。 \n 如圖 \n \n 在製作旋轉軸的時候碰到了很多問題 \n 像是碰撞開啟的狀態下，因為一個支架有兩根軸，並且兩根軸個別連接著一顆齒輪，並且這顆齒輪要互相傳動這造成碰撞開啟的時候會有抖動的狀況，原本想法是先將支架擺在第一排軸擺第二排，連接的一號齒輪擺第三個，傳動的齒輪擺第四個，但傳動的齒輪必須放在支架下面一層，所以只好使用兩種方法都試試看， \n 方法一 \n 依照傳遞順序放 \n \n 方法二 \n 支架第一層，第二層兩根軸，兩根軸下面各放一個齒輪 \n \n 在這之中我還嘗試了許多辦法 \n 最後因為知道了CoppliaSim這個app，在精密度上太過於精確，或是有干涉的話，動畫會跑不動 \n 並且物品會一直亂飛 \n \n 最後使用了 必殺技 才讓轉速可以相接在一起 \n \n', 'tags': '', 'url': 'W7.html'}, {'title': 'killskill', 'text': '把所有碰撞關掉 \n 並且算好速比 \n 影片就會如圖一般順暢 \n', 'tags': '', 'url': 'killskill.html'}, {'title': 'w8', 'text': '', 'tags': '', 'url': 'w8.html'}, {'title': 'stage3-2', 'text': '林晏鈴的網站 \n 林晏鈴的倉儲 \n 劉怡萱的網站 \n 劉怡萱的倉儲 \n 葉沛翎的網站 \n 葉沛翎的倉儲 \n 廖苡雯的網站 \n 廖苡雯的倉儲 \n 陳冠宇的網站 \n 陳冠宇的倉儲 \n 黃翊銘的網站 \n 黃翊銘的倉儲 \n 蔡朝旭的網站 \n 蔡朝旭的倉儲 \n stage3-ag2 的網站 \n stage3-ag2 的倉儲 \n', 'tags': '', 'url': 'stage3-2.html'}, {'title': '教學文件', 'text': '', 'tags': '', 'url': '教學文件.html'}, {'title': '建立cmstemplate網站', 'text': '首先先到老師的網站下載 kmol2021_spring_v2.7z \n 內包含最新版本的 python3.9 \xa0最新版 \n \n 下載完後解壓縮 \n \n 得到 \n \n 將內文的.gitcofig拉到小白\xa0 並且打上[user] \n \n 再去到老師的github倉儲 mdecourse/cmstemplate 建立一新的倉儲 \n \n 建立好後去到setting將GitHub Pages的 Source\xa0 改成main 並儲存 \n \n 再去到小黑 打上下圖將其clone 下來 \n \n 即完成網站建構 \n \n \n \n \n \n', 'tags': '', 'url': '建立cmstemplate網站.html'}, {'title': '建立ssh', 'text': '首先將小黑編輯器打開並寫打上: \n \n 打上\xa0 \n ssh-keygen -t rsa -b 4096 -C "使用者學號" \n \n 第二行為鑰使儲存位置 \n 下一行為輸入密碼 \n 再次輸入密碼 \n 即可獲得要鑰使 \n 在鑰使儲存位置會找到兩個檔案(上為private key 下為 public key) \n \n (3) \n 下載putty工具 \n 會有以下檔案 \n \xa0 \n 利用puttygen.exe \n \n 打開後會發現下圖視窗 \n \n 按下load \n 將剛才的鑰使開啟 \n 將 id_rsa 轉為 Putty 可以解讀的 .ppk 格式 \n \xa0 \n 選擇所使用的鑰使 \n \n 得下圖 \n \xa0 \n \xa0 \n 以私人的形式儲存鑰使 \n \n (4) \n 在github 的settings中找到SSH and GPD keys \n \n 新增鑰使 \n 將id_rsa.pub的內容 \n \n 複製到 \n \n 並且創建一把鑰使 \n (5) \n 修改啟動的 start.bat 加入下列設定 \n set GIT_SSH=%Disk%:\\putty\\plink.exe \n \n (6) \n home 下的 .ssh 目錄中多新增 config 並且內容如下 \n \xa0 \n # no proxy at home \n #ProxyCommand y:/PortableGit/mingw64/bin/connect.exe -H proxy.mde.nfu.edu.tw:3128 %h %p \n # set git_ssh=y:/putty/plink.exe with auth under putty github.com session setup \n ProxyCommand y:/putty/plink.exe github.com %h %p \n \xa0\xa0\xa0 \n Host github.com \n \xa0\xa0\xa0\xa0User git \n \xa0\xa0\xa0\xa0Port 22 \n \xa0\xa0\xa0\xa0Hostname github.com \n \xa0\xa0\xa0\xa0\xa0\xa0 \n \xa0\xa0\xa0\xa0# for connect.exe need openssh key format \n \xa0\xa0\xa0\xa0#IdentityFile "y:\\home\\.ssh\\id_rsa_mdecourse" \n \xa0\xa0\xa0\xa0# for plink.exe need rsa key format but set under putty github.com session \n \xa0\xa0\xa0\xa0# plink.exe do not need the following setting \n \xa0\xa0\xa0\xa0#IdentityFile "y:\\home\\.ssh\\mdecourse_putty_private.ppk" \n \xa0\xa0\xa0 \n \xa0\xa0\xa0\xa0TCPKeepAlive yes \n \xa0\xa0\xa0\xa0IdentitiesOnly yes \n (7) \n cad2020 倉儲中 .git 目錄下的 config 檔案中的連線協定, 由 https 改為採 ssh 連線 \n \xa0 \n (8) \n 點擊putty.exe \n 設定代理主機 \n \n 建一個github.com並且save \n \xa0 \n 點擊proxy並設定 \n 設定代理主機(Proxy)\xa0(除非是IPV4 IPV6才要設定) \n \xa0 \n 設定Auth \n 設定SSH的\xa0ppk private key (之前轉的APK) \n \n 並且按下open後，就可以透過近端的 .ppk private key 與 Github.com 上的 public key 對應, 無需輸入帳號密碼就可以進行 git push \n', 'tags': '', 'url': '建立ssh.html'}, {'title': 'set up Grouping website', 'text': '分組連線操作技巧 \n 首先每個協同者先創一個名稱相同的倉儲 \n 如下圖 \n \n 在近端取得子模組資料後，在小黑輸入git remote add xxx\xa0 https://github.com/ 另一個組員學號 / 倉儲名稱 .git \xa0 \xa0 (づ￣ 3￣)づ (組長做就好) \n \xa0 \n 再到 setting \xa0 的 manage access \xa0 中點選 invite a collaborator \xa0 邀請其他組員 \n \n \xa0 \n 打上組員的名稱 \n 按下 Select a collaborator above \n \n 將在 \xa0 .git 下的 config \xa0 拉到小白中 \n \n 並在最下方打上 ” 下圖文字 ” \n \n 即可以共同協同網站 \n 再推送時使用 git push xxx \n', 'tags': '', 'url': 'set up Grouping website.html'}]};